function I = fcnK2R(S, T, u, alpha, F, tol)
t1 = S .* u;t2 = -t1 + u;t3 = 0.1e1 ./ t2;t4 = sqrt(-u);t5 = F - t4;t6 = 0.1e1 ./ t5;t8 = t5 .^ 2;t10 = t4 .* S;t11 = t5 .* t10;t14 = sqrt(t8 .* S - t1 + 0.2e1 .* t11 + u);t15 = 0.1e1 ./ t14;t18 = t2 .^ 2;t19 = 0.1e1 ./ t18;t23 = S .^ 2;t24 = t19 .* t23;t28 = sqrt(t2);t30 = 0.1e1 ./ t28 ./ t18;t34 = log(0.2e1 .* t6 .* (t14 .* t28 - t1 + t11 + u));t38 = t3 .* S;t44 = 0.1e1 ./ (t2 .* S + u .* t23) ./ 0.4e1;t48 = F + t4;t49 = 0.1e1 ./ t48;t51 = t48 .^ 2;t53 = t48 .* t10;t56 = sqrt(t51 .* S - t1 - 0.2e1 .* t53 + u);t57 = 0.1e1 ./ t56;t69 = log(0.2e1 .* t49 .* (t56 .* t28 - t1 - t53 + u));t78 = 0.1e1 ./ t4;t79 = t3 .* t78;t83 = 0.1e1 ./ u .* t3;t90 = 0.1e1 ./ t28 ./ t2 .* t78;t101 = -t15 .* t6 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t15 .* t19 .* t10 - 0.3e1 ./ 0.4e1 .* F .* t15 .* t24 + 0.3e1 ./ 0.4e1 .* t34 .* t30 .* t10 - 0.2e1 .* t15 .* t44 .* (t5 .* S + t10) .* t38 - t57 .* t49 .* t3 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t57 .* t19 .* t10 - 0.3e1 ./ 0.4e1 .* F .* t57 .* t24 - 0.3e1 ./ 0.4e1 .* t69 .* t30 .* t10 - 0.2e1 .* t57 .* t44 .* (t48 .* S - t10) .* t38 + t15 .* t79 ./ 0.4e1 - F .* S .* t15 .* t83 ./ 0.4e1 - t34 .* t90 ./ 0.4e1 - t57 .* t79 ./ 0.4e1 - F .* S .* t57 .* t83 ./ 0.4e1 + t69 .* t90 ./ 0.4e1;
I = t101(:,:,2) - t101(:,:,1);

end
